const handleFetch = async (query = '') => {
  const res = await fetch(`http://localhost:3000/userData?q=${query}`);
  const userDataArray = await res.json();
  return userDataArray
    .filter((user) => user.name.toLowerCase().includes(query.toLowerCase()))
    .map(({ name, image, link }) => `
          <div class="card">
            <div class="image-list">
              <img src="${image}" alt="${name}" />
            </div>
            <h2>${name}</h2>
            <p>${link}</p>
          </div>
        `).join(' ');
};

const handleRenderUsers = () => {
    handleFetch()
    .then(userDataHTML => {
        const outputElement = document.querySelector("#output");
        outputElement.innerHTML = userDataHTML;
    });
};

handleRenderUsers();

const handleFilter = () => {
  const inputValue = document.querySelector('#input').value;
  handleFetch(inputValue)
    .then(filteredDataHTML => {
      const outputElement = document.querySelector('#output');
      outputElement.innerHTML = filteredDataHTML;
    });
};

const form = document.querySelector("#form");
  form.addEventListener('submit', (e) => {
    e.preventDefault();
    handleFilter();
});
  
  


  
